import { makeStyles } from '@mui/styles';

export const useStyles = makeStyles({
    swap: {
        color: '#fff', 
        border: 2, 
        borderRadius: '50%', 
        borderColor: '#fff', 
        backgroundColor: '#000'
    },
    langBar: {
        backgroundColor: '#ABE3FF', 
        height: '8vh', 
        border: 1, 
        borderColor: '#000',
        borderRadius: 2
    }
});
